import React, { useEffect, useState, useRef } from "react";
import axios from "axios";
import "./BiodiversityPlot.css";

// Taxonomy endpoint
const TAXONOMY_URL = "http://10.121.243.94:8000/taxonomy/map";

const BiodiversityPlot = () => {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // family input (text) default empty
  const [family, setFamily] = useState("");

  // image blob url returned by backend when "Generate Plot" is used
  const [plotImage, setPlotImage] = useState(null);

  const mountedRef = useRef(true);
  const controllerRef = useRef(null);

  // Generate plot: request taxonomy endpoint with ?family=...
  const generatePlot = async () => {
    setError(null);

    const familyTrimmed = (family || "").trim();
    if (!familyTrimmed) {
      setError("Please enter a family name (example: Acoetidae)");
      return;
    }

    setLoading(true);

    // revoke previous blob URL if exists
    if (plotImage) {
      try {
        URL.revokeObjectURL(plotImage);
      } catch (e) {}
      setPlotImage(null);
    }

    // cancel previous request if any
    if (controllerRef.current) {
      try {
        controllerRef.current.abort();
      } catch (e) {}
    }

    const controller = new AbortController();
    controllerRef.current = controller;

    try {
      const response = await axios.get(TAXONOMY_URL, {
        params: { family: familyTrimmed }, // <-- sends ?family=Acoetidae
        responseType: "blob",
        timeout: 30000,
        signal: controller.signal,
        headers: {
          Accept: "image/png, image/jpeg, application/octet-stream",
        },
      });

      if (!mountedRef.current) return;

      const blob = response?.data;
      if (!blob) throw new Error("No image data received from server.");

      const url = URL.createObjectURL(blob);
      setPlotImage(url);
      setError(null);
    } catch (err) {
      if (!mountedRef.current) return;
      if (axios.isCancel?.(err)) {
        console.log("Request cancelled");
      } else {
        console.error("Failed to generate plot:", err);
        if (err.response) {
          setError(`Server returned ${err.response.status}: ${err.response.statusText}`);
        } else if (err.request) {
          setError("No response from server. Confirm backend is running and accessible.");
        } else {
          setError(err.message || "Unknown error");
        }
      }
    } finally {
      if (mountedRef.current) setLoading(false);
    }
  };

  useEffect(() => {
    mountedRef.current = true;
    return () => {
      mountedRef.current = false;
      if (controllerRef.current) {
        try {
          controllerRef.current.abort();
        } catch (e) {}
      }
      if (plotImage) {
        try {
          URL.revokeObjectURL(plotImage);
        } catch (e) {}
      }
    };
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <div className="biodiversity-plot" style={{ padding: 16 }}>
      <header style={{ marginBottom: 12 }}>
        <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
          <h3 style={{ margin: 0 }}>Taxonomy Map (by Family)</h3>

          <div style={{ display: "flex", alignItems: "center", gap: 10 }}>
            <label htmlFor="family-input" style={{ fontSize: "0.9rem", color: "#9ca3af" }}>
              write family name:
            </label>

            <input
              id="family-input"
              type="text"
              placeholder="Acoetidae"
              value={family}
              onChange={(e) => setFamily(e.target.value)}
              style={{
                padding: "6px 12px",
                borderRadius: 8,
                border: "1px solid rgba(148, 163, 184, 0.3)",
                background: "white",
                color: "#111827",
                fontSize: "0.9rem",
                minWidth: 220,
              }}
            />

            <button
              onClick={generatePlot}
              disabled={loading}
              style={{
                padding: "8px 20px",
                borderRadius: 999,
                border: "none",
                background: loading ? "#94a3b8" : "#06b6d4",
                color: loading ? "#9ca3af" : "#020617",
                fontSize: "0.9rem",
                fontWeight: 600,
                cursor: loading ? "not-allowed" : "pointer",
              }}
            >
              {loading ? "Generating..." : "Generate Plot"}
            </button>
          </div>
        </div>
        <p style={{ marginTop: 8 }}>
          Enter a family name and click "Generate Plot" to view the taxonomy map (example URL format: <code>http://10.121.243.94:8000/taxonomy/map?family=Acoetidae</code>).
        </p>
      </header>

      {/* Display errors if any */}
      {error && <div style={{ color: "#b91c1c", marginBottom: 12 }}>{error}</div>}

      {/* If backend returned an image blob via Generate Plot, show it as <img> */}
      {plotImage ? (
        <div style={{ marginTop: 12 }}>
          <img
            src={plotImage}
            alt={`taxonomy-${family}`}
            style={{ width: "100%", maxHeight: 700, objectFit: "contain", borderRadius: 8, border: "1px solid rgba(148,163,184,0.15)" }}
          />
        </div>
      ) : (
        <div style={{ marginTop: 12, color: "#6b7280" }}>
          No plot loaded. Enter a family and click <strong>Generate Plot</strong>.
        </div>
      )}
    </div>
  );
};

export default BiodiversityPlot;
